import styled from "styled-components";

function Refrigerator() {
  return (
    <Main>
      <div className="container">
        <div className="top">
          <h1>Jay님의 냉장고</h1>
          <div>
            <span>냉동실</span>
            <span>따로 관리하기→</span>
          </div>
          <div>재료 맵핑</div>
        </div>
        <div className="bottom">
          <div>
            <span>냉장고</span>
            <span>따로 관리하기→</span>
          </div>
          <div>재료 맵핑</div>
          <div>
            <button>레시피 추천받기</button>
            <button>재료 추가하기 ╋</button>
          </div>
        </div>
      </div>
    </Main>
  );
}

export const Main = styled.div`
  background-color: blanchedalmond;
  overflow-y: hidden;
  .top {
    height: 46.25vh;
    border-color: bisque;
  }
  .bottom {
    height: 46.25vh;
    background-color: aqua;
  }
`;

export default Refrigerator;
